import "./index.css";
import Header from "./components/Header";
import TitleSection from "./components/TitleSection";
import CriteriaSection from "./components/CriteriaSection";

function App() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
  };

  return (
    <div>
      <Header />
      <TitleSection />
      <CriteriaSection />
    </div>
  );
}

export default App;
